import React from "react";
import resume from "../assets/current_resume.pdf"
import {
    ResumeIframe
} from "./PageElements";
const Resume = () => {
    return(
    <div>
        <ResumeIframe src={resume}></ResumeIframe>
    </div>);
}

export default Resume;
